import Button from 'react-bootstrap/Button';
import Container from 'react-bootstrap/Container';

function App() {
  return (
    <Container>
      <Form.Control type='number'></Form.Control>
      <Button>
        Calculate
      </Button>
    </Container>
  );
}

export default App;
